  <script>
    var url = "{{url('get-graph-math/'.$student_id)}}";
    var Weeks = new Array();
    var Marks = new Array();
    var subject;
    $(document).ready(function(){
      $.get(url, function(response){
response.forEach(function(data){
  Weeks.push(data.week_name)
  Marks.push(data.obtained_marks)
  subject=data.name
//  console.log(data.week_name)
});
const data = {
labels: Weeks,
datasets: [{
label: 'Your '+subject+' Progress',
backgroundColor: ['green', 'red', 'orange', 'purple' ],
borderColor: 'rgb(255, 99, 132)',
data: Marks,
}]
};
const config = {
type: 'line',
data: data,
options: {}
};
var myChart = new Chart(
document.getElementById('score-chart'),
config
);
      });
    });
</script>


